import * as React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from "react-native";
import Icon from 'react-native-vector-icons/FontAwesome';

export default function ListaTell({ navigation }) {
  return (
    <>
          <Header
        backgroundImageStyle={{}}
        barStyle="default"
        centerComponent={{
          text: "MY TITLE",
          style: { color: "#fff" }
        }}
        centerContainerStyle={{}}
        containerStyle={{ width: 350 }}
        leftContainerStyle={{}}
        linearGradientProps={{}}
        placement="center"
        rightComponent={{
          icon: "add",
          color: "#fff",
          onPress: () => navigation.navigate("NovoContato") // Adicione a navegação aqui
        }}
        rightContainerStyle={{}}
        statusBarProps={{}}
      />
      <View style={styles.header}>
        <Text style={styles.title}>Lista de Contatos</Text>
        <TouchableOpacity onPress={() => navigation.navigate("NovoContato")}>
          <Icon name="plus" size={30} color="#fff" />
        </TouchableOpacity>
      </View>

      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text>Bem vindo ao sistema</Text>
      </View>
    </>

  );
}

const styles = StyleSheet.create({
  header: {
    height: 50,
    backgroundColor: "#1670f7",
    borderBottomColor: "#000000",
    flexDirection: 'row',
    alignItems: "center",
    justifyContent: "space-around",
  },
  title: {
    fontSize: 20,
    fontWeight: "bold",
    color: "#ffff",
  },
});
